import React from 'react';
import {StyleSheet} from 'react-native';

export default StyleSheet.create({

    header:{
        backgroundColor: '#FF0000',
        width: '100%',
        height: '5%',
        alignItems: 'center',
        marginTop: '7%',
        justifyContent: 'center',
    }
})
